    //       </Route>
    //     </Switch>
    //   </Router>
    //   {/* <MyLocation /> */}
    //   {/* <LogHistory /> */}
    //   {/* <Notification /> */}
    //   {/* <Quarantine /> */}
    //   {/* <Profile /> */}
    // </div>
  );
}

export default App;
